IF OBJECT_ID('dbo.proc_transform_142', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_142;
GO
CREATE PROCEDURE dbo.proc_transform_142
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_142
    SET payload = LEFT(payload, 1000) + N'|V4-142|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_142;
END
GO
IF OBJECT_ID('dbo.audit_v4_142', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_142 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_142;
